window.bookSummaryJSON = "<p>Earth, AD 2519. The clone soldiers of the Enlisted Man’s Empire, formerly members of the Unified Authority’s powerful military, maintain a tenuous grasp on the power they fought so hard to gain. But the U.A. will not be so easy to suppress as they had hoped....</p> <p>A provocateur attacks the Pentagon. Gunships converge on the penitentiary where Unified Authority war criminals are held. And a clone assassin murders Admiral Don Cutter, commander in chief of the Enlisted Man's Empire....</p> <p>It all happens at once — and five minutes later, more assassins attack Wayson Harris as he prepares for a summit with delegates of Olympus Kri. With Harris missing and their most deadly enemies on the loose, the remaining officers of the Empire must uncover a plot to overthrow their government while preparing for war....</p> <p>Performed by Ken Jackson, Terence Aselford, Joel David Santner, Elliot Dash, David Jourdan, David Harris, Steve Wannall, Michael John Casey, Richard Cutting, Michael Glenn, Elizabeth Jernigan, Nick DePinto, James Lewis, Matthew Bassett, Richard Rohan, Scott McCormick, Thomas Penny, Daniel Sonntag, Tracy Lynn Olivera, Yasmin Tuazon, Christopher Graybill, Tim Pabon, Christopher Scheeren, Mort Shelby, Dylan Lynch.</p>"; 
